properties.widgets.Oracle-connector:
{
  "outputs": [],
  "metadata": {"spec-version": "1.0"},
  "configuration-groups": [
    {
      "label": "Basic",
      "properties": [
        {
          "widget-type": "plugin-list",
          "name": "jdbcPluginName",
          "label": "JDBC Driver name",
          "widget-attributes": {"plugin-type": "jdbc"}
        },
        {
          "widget-type": "textbox",
          "name": "host",
          "label": "Host",
          "widget-attributes": {"default": "localhost"}
        },
        {
          "widget-type": "number",
          "name": "port",
          "label": "Port",
          "widget-attributes": {"default": "1521"}
        },
        {
          "name": "connectionType",
          "widget-type": "radio-group",
          "label": "Connection Type",
          "widget-attributes": {
            "layout": "inline",
            "default": "SID",
            "options": [
              {
                "id": "SID",
                "label": "SID"
              },
              {
                "id": "service",
                "label": "Service Name"
              },
              {
                "id": "TNS",
                "label": "TNS Connect Descriptor"
              }
            ]
          }
        },
        {
          "widget-type": "textbox",
          "name": "database",
          "description": "Oracle connection point (Database name, Service name, or TNS Connect Descriptor)",
          "label": "SID/Service Name/TNS Connect Descriptor"
        }
      ]
    },
    {
      "label": "Credentials",
      "properties": [
        {
          "widget-type": "textbox",
          "name": "user",
          "label": "Username"
        },
        {
          "widget-type": "password",
          "name": "password",
          "label": "Password"
        },
        {
          "name": "role",
          "widget-type": "radio-group",
          "label": "Role",
          "widget-attributes": {
            "layout": "inline",
            "default": "normal",
            "options": [
              {
                "id": "normal",
                "label": "Normal"
              },
              {
                "id": "sysdba",
                "label": "SYSDBA"
              },
              {
                "id": "sysoper",
                "label": "SYSOPER"
              }
            ]
          }
        },
        {
          "widget-type": "select",
          "name": "transactionIsolationLevel",
          "label": "Transaction Isolation Level",
          "widget-attributes": {
            "default": "TRANSACTION_SERIALIZABLE",
            "values": [
              "TRANSACTION_READ_COMMITTED",
              "TRANSACTION_SERIALIZABLE"
            ]
          }
        }
      ]
    },
    {
      "label": "Advanced",
      "properties": [{
        "widget-type": "keyvalue",
        "name": "connectionArguments",
        "label": "Connection Arguments",
        "widget-attributes": {
          "kv-delimiter": "=",
          "key-placeholder": "Key",
          "value-placeholder": "Value",
          "delimiter": ";",
          "showDelimiter": "false"
        }
      }]
    }
  ],
  "display-name": "Oracle",
  "filters": [{
    "condition": {"expression": "role  == 'normal'"},
    "name": "showIsolationLevels",
    "show": [{
      "name": "transactionIsolationLevel",
      "type": "property"
    }]
  }]
}
